// src/components/sections/AvailabilityDatesList.js
import React, { useState } from 'react';
import './AvailabilityDates.css';

function AvailabilityDates() {
  const [availabilityDates, setAvailabilityDates] = useState([]);
  const [newAvailability, setNewAvailability] = useState({
    availabilityId: '',
    doctorId: '',
    fromDate: '',
    toDate: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewAvailability((prevAvailability) => ({
      ...prevAvailability,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setAvailabilityDates((prevAvailabilityDates) => [
      ...prevAvailabilityDates,
      newAvailability
    ]);
    setNewAvailability({
      availabilityId: '',
      doctorId: '',
      fromDate: '',
      toDate: ''
    });
  };

  const handleDelete = (id) => {
    const updatedList = availabilityDates.filter((item) => item.availabilityId !== id);
    setAvailabilityDates(updatedList);
  };

  const handleEdit = (id) => {
    const availabilityToEdit = availabilityDates.find((item) => item.availabilityId === id);
    setNewAvailability(availabilityToEdit); // Pre-fill the form for editing
  };

  return (
    <div className="availability-dates-list">
      <h2>Availability Dates List</h2>

      {/* Add Availability Dates Form */}
      <div className="add-availability">
        <h3>Add Availability Date</h3>
        <form onSubmit={handleSubmit}>
          <label>
            Availability ID:
            <input
              type="text"
              name="availabilityId"
              value={newAvailability.availabilityId}
              onChange={handleChange}
              required
            />
          </label>
          <label>
            Doctor ID:
            <input
              type="text"
              name="doctorId"
              value={newAvailability.doctorId}
              onChange={handleChange}
              required
            />
          </label>
          <label>
            From Date:
            <input
              type="date"
              name="fromDate"
              value={newAvailability.fromDate}
              onChange={handleChange}
              required
            />
          </label>
          <label>
            To Date:
            <input
              type="date"
              name="toDate"
              value={newAvailability.toDate}
              onChange={handleChange}
              required
            />
          </label>
          <button type="submit">Add Availability</button>
        </form>
      </div>

      {/* Availability Dates List */}
      <div className="availability-table">
        <h3>List of Available Dates</h3>
        <table>
          <thead>
            <tr>
              <th>Availability ID</th>
              <th>Doctor ID</th>
              <th>From Date</th>
              <th>To Date</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {availabilityDates.map((availability, index) => (
              <tr key={index}>
                <td>{availability.availabilityId}</td>
                <td>{availability.doctorId}</td>
                <td>{availability.fromDate}</td>
                <td>{availability.toDate}</td>
                <td>
                  <button onClick={() => handleEdit(availability.availabilityId)}>Edit</button>
                  <button onClick={() => handleDelete(availability.availabilityId)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default AvailabilityDates;
